int calc_roman(char pch[]) {
  int res = 0;
  int ii;
  int length = strlen(pch);
  int previous = 1000;

  if (strcmp(pch,"XL") == 0) strcpy(pch,"XI");
  if (strcmp(pch,"VL") == 0) strcpy(pch,"VI");

  for (ii = 0; ii < length; ii++) {
    switch(pch[ii]) {
    case 'M':
    case 'm':
      res += 1000;
      if (previous < 1000) {
	res -= 2 * previous;
      }
      previous = 1000;
      break;
    case 'D':
    case 'd':
      res += 500;
      if (previous < 500) {
	res -= 2 * previous;
      }
      previous = 500;
      break;
    case 'C':
    case 'c':
      res += 100;
      if (previous < 100) {
	res -= 2 * previous;
      }
      previous = 100;
      break;
    case 'L':
    case 'l':      
      res += 50;
      if (previous < 50) {
	res -= 2 * previous;
      }
      previous = 50;
      break;
    case 'X':
    case 'x':
      res += 10;
      if (previous < 10) {
	res -= 2 * previous;
      }
      previous = 10;
      break;
    case 'V':
    case 'v':
      res += 5;
      if (previous < 5) {
	res -= 2 * previous;
      }
      previous = 5;
      break;
    case 'I':
    case 'i':
      res += 1;
      if (previous < 1) {
	res -= 2 * previous;
      }
      previous = 1;
      break;
    }      // switch
  } // for ii
  //if (debug) fprintf(stderr,"ROMAN:in=%s: out=%d: ll=%d:\n",pch,res,length);
  return(res);
}

