int substitute_underscore(char *text) {
  int ii;
  for (ii = 0; ii < strlen(text); ii++) {
    if (text[ii] == '_' && text[ii-1] == ':' && text[ii-2] == '_' && (text[ii-3] == '0' || text[ii-3] == '1')) {
      if (text[ii-3] == '0') {
	text[ii] = '\''; text[ii-1] = ' '; text[ii-2] = ' ';text[ii-3] = ' ';
      } else {
	text[ii] = ' '; text[ii-1] = ' '; ; text[ii-2] = ' ';text[ii-3] = '\'';
      }
    }
  }
  return 0;
}

